import React from 'react';
import cardData from '../data/employee';

const Card = () => {
  return (
    <div className="w-[460px] h-72 flex justify-between filter drop-shadow-2xl rounded-12">
        <img src={cardData.image} alt="doctorImage" />
        <div className="w-56">
            <p>Id: {cardData.id}</p>
            <p>First Name: {cardData.fname}</p>
            <p>Last Name: {cardData.lname}</p>
            <p>Department: {cardData.department}</p>
            <p>Language: {cardData.language.join(', ')}</p>
        </div>
    </div>
  )
}

export default Card;
